    false,nt"url": null,nt"notes": "This annual narrative report for Selawik
    National WIldlife Refuge outlines Refuge accomplishments during the 2000 calendar
    year. The report begins with an introduction to the Refuge. Highlights and weather
    conditions are summarized for the year. Information about monitoring and studies-
    including surveys and censuses and studies and investigations- is provided next.
    Fish and wildlife management are discussed next with emphasis on bird banding and
    disease monitoring. Coordination activities, such as interagency coordination and
    tribal coordination, are outlined. The resource protection section provides an update
    on law enforcement, permits, and land acquisition support. Information about public
    education and recreation is given including visitor services and outreach. Finally,
    comprehensive management planning and general administration are discussed in the
    Refuge planning and administration section. Provisions unique to Alaska include
    subsistence, public access, manage commercial/subsistence fisheries.",nt"owner_org":
